    "2015-05-07T01:17:23.804576",nt"name": "magnesium-diboride-superconducting-coils-for-electric-propulsion-systems-for-large-aircraf-65424",nt"isopen":
    true,nt"url": null,nt"notes": "The recent development of magnesium diboride
    superconducting wires makes possible the potential to have much lighter weight superconducting
    coils for heavy aircraft motors than with any other potential metal or ceramic superconductor.
    The magnesium diboride superconductor can be cooled to 20 K by the liquid hydrogen
    fuel.   The lighter weight coils, especially in the rotor, will enable a lighter
    weight support structure so the motor weight will be reduced even more for the same
    horsepower motor.  For this NASA SBIR Phase II our objective is to design, construct,
    test, and assembly MgB2 rotor coil packs to replace the copper rotor coil packs
    for the cryogenic motor test bed being built for NASA",nt"license_title": "U.S.
